import Topbar from '../Topbar/Topbar';
import { Outlet } from 'react-router-dom';

const Layout = () => {
  return (
    <div>
        <Topbar />
        <Outlet />
        <h2>Pomodoro</h2>
    </div>
  );
};

export default Layout;
